import React from 'react';
import { Rocket, Shield, Users, Lightbulb, Handshake } from 'lucide-react';

// Internal components defined in App.jsx (will be included in App.jsx's scope)
// We assume Navbar and Footer are imported/defined elsewhere, as they are used here.

// Placeholder for the Navbar component (for self-containment/structure)
const Navbar = ({ handleNavigation }) => (
    <div className="sticky top-0 z-50 bg-white shadow-md p-4 text-center">
        <a 
            // FIX: Added safety check to prevent TypeError if handleNavigation is not passed or is undefined
            onClick={() => handleNavigation && handleNavigation('public')} 
            className="cursor-pointer text-xl font-bold text-[#1F3B66] hover:text-[#D4A74B] transition duration-200"
        >
            ARM <span className="text-[#D4A74B]">Group</span>
        </a>
    </div>
);

// Placeholder for the Footer component (for self-containment/structure)
const Footer = () => (
    <footer className="bg-[#1F3B66] py-10">
        <div className="max-w-7xl mx-auto px-4 text-center text-gray-400">
            &copy; {new Date().getFullYear()} ARM Group. All rights reserved.
        </div>
    </footer>
);


const SectionHeader = ({ icon: Icon, title, subtitle }) => (
    <div className="text-center mb-12">
        <Icon className="w-10 h-10 text-[#D4A74B] mx-auto mb-3" />
        <h2 className="text-4xl font-extrabold text-[#1F3B66] tracking-tight mb-2">{title}</h2>
        <p className="text-xl text-gray-600 max-w-3xl mx-auto">{subtitle}</p>
    </div>
);

const ValueCard = ({ icon: Icon, title, description }) => (
    <div className="p-6 bg-white rounded-xl shadow-lg border-t-4 border-[#D4A74B] transform hover:scale-[1.02] transition duration-300">
        <Icon className="w-8 h-8 text-[#1F3B66] mb-3" />
        <h3 className="text-xl font-bold text-[#1F3B66] mb-2">{title}</h3>
        <p className="text-gray-600 text-sm">{description}</p>
    </div>
);


const CompanyProfile = ({ handleNavigation }) => {
    // Content sourced and synthesized from the ARM Group Presentation PDF
    const coreValues = [
        { icon: Shield, title: "Integrity", description: "We operate with transparency and honesty in all business dealings." },
        { icon: Rocket, title: "Excellence", description: "We strive to deliver top-quality services that consistently exceed expectations." },
        { icon: Handshake, title: "Commitment", description: "Dedicated to client satisfaction and continuous improvement in service delivery." },
        { icon: Users, title: "Teamwork", description: "We believe collaboration is key to achieving collective goals and greater success." },
        { icon: Lightbulb, title: "Innovation", description: "Continuously improving processes and training for better, more efficient service delivery." },
    ];

    return (
        <div className="min-h-screen flex flex-col bg-gray-50">
            {/* The Navbar from App.jsx's PublicView will be used, 
                but including a placeholder here for layout structure */}
            <Navbar handleNavigation={handleNavigation} />
            
            <main className="flex-grow pt-16 pb-24">
                <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                    
                    {/* Hero Section */}
                    <header className="text-center mb-16 pt-8">
                        <h1 className="text-6xl font-extrabold text-[#1F3B66] mb-4">
                            Our <span className="text-[#D4A74B]">Company Profile</span>
                        </h1>
                        <p className="text-2xl text-gray-500 font-light max-w-4xl mx-auto">
                            Excellence in Manpower Solutions. Recognized for reliability and innovation in workforce management.
                        </p>
                        <a 
                            // FIX: Added safety check to prevent TypeError if handleNavigation is not passed or is undefined
                            onClick={() => handleNavigation && handleNavigation('public')}
                            className="inline-flex items-center mt-6 px-6 py-3 border border-transparent text-base font-medium rounded-xl shadow-sm text-white bg-[#D4A74B] hover:bg-[#A88F68] transition duration-300 cursor-pointer"
                        >
                            Back to Home
                        </a>
                    </header>

                    {/* Overview Section */}
                    <section className="mb-20 p-8 md:p-12 bg-white rounded-3xl shadow-2xl border-l-8 border-[#1F3B66]">
                        <SectionHeader 
                            icon={Users} 
                            title="Company Overview" 
                            subtitle="Specializing in skilled manpower solutions for diverse industries."
                        />
                        <div className="text-lg text-gray-700 leading-relaxed space-y-4">
                            <p>
                                ARM Group specializes in providing **skilled manpower** on a rental and local transfer basis, as well as managing large-scale recruiting from overseas to meet diverse client requirements across multiple industries. Our services are engineered to ensure clients have immediate access to qualified professionals whenever needed, which is critical for maintaining **efficiency, reducing operational costs**, and achieving long-term strategic success.
                            </p>
                            <p className="border-l-4 border-[#D4A74B] pl-4 italic bg-gray-50 p-4 rounded-lg">
                                **Industry Focus:** Oil & Gas, Construction, Hospitality, Logistics, and General Services.
                            </p>
                        </div>
                    </section>

                    {/* Vision & Mission Section */}
                    <section className="mb-20 grid grid-cols-1 md:grid-cols-2 gap-10">
                        {/* Vision */}
                        <div className="p-8 bg-[#1F3B66] text-white rounded-3xl shadow-xl">
                            <Rocket className="w-10 h-10 text-[#D4A74B] mb-4" />
                            <h3 className="text-3xl font-bold mb-3">Our Vision</h3>
                            <p className="text-gray-300 text-lg">
                                To be the **leading manpower solutions provider** recognized for excellence, reliability, and innovation in workforce management across the region.
                            </p>
                        </div>
                        {/* Mission */}
                        <div className="p-8 bg-white text-gray-800 rounded-3xl shadow-xl border border-gray-200">
                            <Lightbulb className="w-10 h-10 text-[#1F3B66] mb-4" />
                            <h3 className="text-3xl font-bold mb-3">Our Mission</h3>
                            <p className="text-gray-700 text-lg">
                                To deliver qualified, trained, and motivated manpower that drives our clients' success while fostering growth, safety, and satisfaction among our dedicated workforce.
                            </p>
                        </div>
                    </section>
                    
                    {/* Core Values Section */}
                    <section className="mb-20">
                        <SectionHeader 
                            icon={Handshake} 
                            title="Our Core Values" 
                            subtitle="The principles guiding every action and decision we make."
                        />
                        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-5 gap-6">
                            {coreValues.map((value, index) => (
                                <ValueCard key={index} {...value} />
                            ))}
                        </div>
                    </section>
                </div>
            </main>

            {/* The Footer from App.jsx's PublicView will be used, 
                but including a placeholder here for layout structure */}
            <Footer />
        </div>
    );
};

export default CompanyProfile;
